import { createMuiTheme } from '@material-ui/core/styles';

export const theme = createMuiTheme({
  typography: {
    fontFamily: "\"GlacialIndifference\"",
   },
  palette: {
    primary: {
      main: '#0d253f',
    },
    secondary: {
      main: '#01b4e4',
    },
    background: {
      default: "#efeeee"
    },
  },
});
